import React, { Component } from 'react';

class Home extends Component {
  render() {

    return(
    <div>
      homepage
    </div>
    )
  }
}

class About extends Component {
  render() {

    return(
    <div>
      project links
    </div>
    )
  }
}
class Projects extends Component {
  render() {

    return(
    <div>
      all the stuff for projects
    </div>
    )
  }
}

module.exports = {
  Home,
  About,
  Projects
}
